import ListItem from './ListItem.js'

const List = ({countries,newFilter,})=>{
    return(
        <div>
            {countries.filter(c=> c.name.toLowerCase().includes(newFilter.toLowerCase()))
            .map(c => <ListItem key={c.name} c={c}/>)}
        </div>
    )
}

export default List
